features.script:
let spgbtn = parcel.getFeatureById('spring-btn'), spgsign = parcel.getFeatureById('spring-sign'), spgMove = spgsign.createAnimation('position'), walletCollect = [];

mvSign = () => {
  /*try {
  let waitMv = waitForDoneo1(waiting=true, 150);
  await waitMv;}
  catch (error) {console.error(error);}*/
  console.log('moving sign!');
  spgMove.setKeys([{
      frame: 10,
      value: spgsign.position.add(new Vector3(0,1.8,0))
    }]);
  spgsign.startAnimations( [spgMove]);
  spgsign.position.y = 1.8;
};

spgbtn.on('click', e => {
  console.log('wallet:', e.player.wallet);
  walletCollect.push(e.player.wallet);
  console.log('wallet from array:', walletCollect[0]);
  mvSign();
});
